import{_ as e,o as r,c as a,O as i}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 22.1-263 Violation constitutes misdemeanor.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/22.1-263.md","filePath":"vacode/22.1-263.md"}'),t={name:"vacode/22.1-263.md"},o=i('<h1 id="§-22-1-263-violation-constitutes-misdemeanor" tabindex="-1">§ 22.1-263 Violation constitutes misdemeanor. <a class="header-anchor" href="#§-22-1-263-violation-constitutes-misdemeanor" aria-label="Permalink to &quot;§ 22.1-263 Violation constitutes misdemeanor.&quot;">​</a></h1><p>Any person violating the provisions of either § <a href="http://law.lis.virginia.gov/vacode/22.1-254/" target="_blank" rel="noreferrer">22.1-254</a>, except for clause (ii) of subsection A, §§ <a href="http://law.lis.virginia.gov/vacode/22.1-255/" target="_blank" rel="noreferrer">22.1-255</a>, <a href="http://law.lis.virginia.gov/vacode/22.1-258/" target="_blank" rel="noreferrer">22.1-258</a>, <a href="http://law.lis.virginia.gov/vacode/22.1-267/" target="_blank" rel="noreferrer">22.1-267</a>, or the parental responsibility provisions relating to compulsory school attendance included in § <a href="http://law.lis.virginia.gov/vacode/22.1-279.3/" target="_blank" rel="noreferrer">22.1-279.3</a>, shall be guilty of a Class 3 misdemeanor. Upon a finding that a person knowingly and willfully violated any provision of § <a href="http://law.lis.virginia.gov/vacode/22.1-254/" target="_blank" rel="noreferrer">22.1-254</a>, except for clause (ii) of subsection A, or any provision of §§ <a href="http://law.lis.virginia.gov/vacode/22.1-255/" target="_blank" rel="noreferrer">22.1-255</a>, <a href="http://law.lis.virginia.gov/vacode/22.1-258/" target="_blank" rel="noreferrer">22.1-258</a>, or § <a href="http://law.lis.virginia.gov/vacode/22.1-267/" target="_blank" rel="noreferrer">22.1-267</a> and that such person has been convicted previously of a violation of any provision of § <a href="http://law.lis.virginia.gov/vacode/22.1-254/" target="_blank" rel="noreferrer">22.1-254</a>, except for clause (ii) of subsection A, or any provision of §§ <a href="http://law.lis.virginia.gov/vacode/22.1-255/" target="_blank" rel="noreferrer">22.1-255</a>, <a href="http://law.lis.virginia.gov/vacode/22.1-258/" target="_blank" rel="noreferrer">22.1-258</a> or § <a href="http://law.lis.virginia.gov/vacode/22.1-267/" target="_blank" rel="noreferrer">22.1-267</a>, such person shall be guilty of a Class 2 misdemeanor.</p><p>Code 1950, § 22-275.5; 1959, Ex. Sess., c. 72; 1976, c. 283; 1980, c. 559; 1990, c. 797; 1991, c. 295; 1996, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0891" target="_blank" rel="noreferrer">891</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP0964" target="_blank" rel="noreferrer">964</a>; 1999, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0488" target="_blank" rel="noreferrer">488</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0526" target="_blank" rel="noreferrer">526</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?991+ful+CHAP0552" target="_blank" rel="noreferrer">552</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0573" target="_blank" rel="noreferrer">573</a>.</p>',3),n=[o];function l(s,g,c,f,v,h){return r(),a("div",null,n)}const _=e(t,[["render",l]]);export{d as __pageData,_ as default};
